import React from "react";
import BackendAPI from "../API/BackendAPI.jsx";

export default function AuctionList(){
    const auctionList = BackendAPI.GetAllAuctions();

    return(
        <div key="auctionList">
            List of Auctions
                {
                    auctionList.map((element, index) => (
                    <p>{element["name"]}</p>
                    ))
                }
        </div>
    )
}
